import React from "react";
import ReactDOM from 'react-dom/client';

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
    <>
<h1>Best Colors to CHoose</h1>
<p>Get the Colore from the scratch</p>
<ul>
    <li>red</li>
    <li>green</li>
    <li>yellow</li>
    <li>white</li>

</ul>
</>

    )




